public class ParameterMetadata(bool constantExpected, int? constantMin, int? constantMax)
{
    public bool ConstantExpected { get; } = constantExpected;
    public int? ConstantMin { get; } = constantMin;
    public int? ConstantMax { get; } = constantMax;
}

public class Api(string namespaceName, string className, string methodName, FuzzType returnType, FuzzType[] parameterTypes, ParameterMetadata[] parameterMetadata)
{
    public string NamespaceName { get; } = namespaceName;
    public string ClassName { get; } = className;
    public string MethodName { get; } = methodName;
    public FuzzType ReturnType { get; } = returnType;
    public FuzzType[] ParameterTypes { get; } = parameterTypes;
    public ParameterMetadata[] ParameterMetadata { get; } = parameterMetadata;
}

